エルメス 　テール ドゥ エルメス　EDT SP 50ml<BR><BR><img src="http://image.rakuten.co.jp/wish/cabinet/new/as460.jpg">エルメス 　テール ドゥ エルメス　EDT SP 50ml<BR><hr><br><FONT size="+1" color="#0033FF">for men</FONT>
<BR>
世界的パヒューマー、ジャン・クロード・エレナ氏により手がけられたメンズフレグランス、<BR>テール ドゥ エルメス。　<BR>大地から空気へと、河から大海へと。<BR>大地と空の間の水分はさまざまに変化する。<BR>地球を構成するエレメントが超自然的に変容を遂げつづける、<BR>力強い錬金術のストーリー。<BR><BR>

木や石の温もりを感じさせるウッディで植物性の、ミネラルのノート。<BR>上品で心地よい爽やかさに包まれる香りです。

