プレミアム ヴィダルサスーン カラーケア シャンプー つめかえ用 350ml<br>ブランド：ヴィダルサスーン<br>販売・製造元：P&G(プロクター・アンド・ギャンブル)<br><br>美しさ色あせない、ダイヤモンドのように輝く髪を演出するカラーリングヘア用シャンプーです。<br>髪にツヤを与えてカラーをより美しく、色あせの原因から髪を守ります。<br>カラーリングによるダメージを内から補修。<br>髪１本1本をなめらかにし、根元から毛先まで髪表面を整えるので、どんなに動いても、髪が光を反射し、きらきらと輝く髪になります。<br>贅沢に咲き匂うラグジュアリーブーケの香り。<br>詰め替え用。<br> <br><br>ポンプボトルへのつめかえ方1.つめかえ口の付け根部分をしっかり持ってキャップを矢印の方向にまわして開けて下さい。<br>開ける際にはキャップの切り口と液の飛び出しに気をつけて下さい。<br>2.つめかえ口をボトルの口に差し込んで両手で固定して注ぎ入れて下さい。<br>●つめかえ前にボトルの中とポンプの部分を水道水でよく洗い、乾燥させてから一度に全量つめかえて下さい。<br>●必ずプレミアムヴィダルサスーン カラーケア シャンプーの使用済みポンプボトルにつめかえて下さい。<br>●飲み物ではありません。<br>●お子様の手の届かない所に置いてください。<br> <br><br>使用上の注意<br>・頭皮に傷、はれもの、湿疹等のあるときは使わないで下さい。<br>・使用前や使用後に刺激等の異常が現れたときは使用を中止し、皮ふ科専門医等にご相談されることをおすすめします。<br>・目に入ったときは、直ちに洗い流して下さい。<br> <br>成分<br>水、ラウレス硫酸アンモニウム、ラウロアンホ酢酸Na、ジステアリン酸グリコール、コカミドプロピルベタイン、ラウリル硫酸アンモニウム、コカミドMEA、セタノール、香料、ジメチコン、ポリクオタニウム-10、クエン酸Na、クエン酸、水添ポリデセン、安息香酸Na、EDTA-2Na、ホホバ種子油、メチルクロロイソチアゾリノン、メチルイソチアゾリノン、キシレンスルホン酸アンモニウム、塩化Na<br> 原産国タイ シャンプー全部とは髪と頭皮についたホコリ・あせ・皮脂などの汚れを洗い流します。<br><br>日用品／ヘアケア／シャンプー／シャンプー カラーリングヘア用<br>JANコード： 4902430215077<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
